description:
Minecraft 1.9 prerelease 6.

Includes everything to play. Also fixed the batch installer, thanks guys for informing.

If you have questions or problems, please post here or contact me through email.
Before posting I recommend updating your video card drivers because it seems to be most common problem with new minecraft releases.

